import React from 'react';

import './RentBikeItem.css';

const RentBikeItem = ({props}) => {
    const { name, type, price } = props;
    console.log(props)
    return (
        <div>
            {`${name} / ${type} / $${price}`}
        </div>
    );
};

export default RentBikeItem;
